def factorial(n):
    if n == 0 or n == 1:
        return 1
    return n * factorial(n - 1)

if __name__ == '__main__':
    n = int(input())
    result = factorial(n)
    print(result)

def two_sum(nums, target):
    for i in range(len(nums)):
        for j in range(i + 1, len(nums)):
            if nums[i] + nums[j] == target:
                return [i, j]
    return []

if __name__ == '__main__':
    import json
    data = input()
    parsed = json.loads(data)
    nums = parsed['nums']
    target = parsed['target']
    result = two_sum(nums, target)
    print(json.dumps(result))

def is_palindrome(s):
    s = s.lower()
    s = s.replace(' ', '')
    return str(s == s[::-1])

if __name__ == '__main__':
    s = input()
    result = is_palindrome(s)
    print(result)

def factorial(n):
    result = 1
    for i in range(1, n + 1):
        result *= i
    return result

if __name__ == '__main__':
    n = int(input())
    result = factorial(n)
    print(result)

def fizzbuzz(n):
    result = []
    for i in range(1, n + 1):
        output = ''
        if i % 3 == 0:
            output += 'Fizz'
        if i % 5 == 0:
            output += 'Buzz'
        if not output:
            output = str(i)
        result.append(output)
    return result

if __name__ == '__main__':
    n = int(input())
    result = fizzbuzz(n)
    for item in result:
        print(item)
